import React from "react";
import Peak from "../Peak/Peak";
import s from "./PeakContainer.module.css";
import { getAllPeaks } from "../../services";
import {
    useLoaderData,
} from "react-router-dom";

export async function loader() {
    const peaks = await getAllPeaks();
    console.log('peaks', peaks);
    return { peaks }
}

const PeakContainer = () => {

    const peakData = useLoaderData();
    console.log('in jsx', peakData);

    return (
        <div className={s.peakContainer}>
            {
                peakData.length ? peakData.map((peak, i) => (
                    <Peak
                        key={peak.id}
                        peak={peak}
                    />
                ))
                : <div>Something went wrong. No peaks.</div>
            }

        </div>
    )
}

export default PeakContainer;
